import React, { Component } from 'react'
import './SideNavBar.css'


class SideNavBar extends Component {
    render() {
        return (
            <div className="sidenav">
                <a href="http://www.sarkology.net/">nav1</a>
                <a href="http://www.sarkology.net/">nav2</a>
                <a href="http://www.sarkology.net/">nav3</a>
                <a href="http://www.sarkology.net/">nav4</a>
            </div>
        )
    }
}

export default SideNavBar
